import { React, CSSProperties } from "react";
import ClipLoader from "react-spinners/ClipLoader";
const Loader = () => {

  const override: CSSProperties = {
    display: "block",
    margin: "12px auto",

  };

  return (
    <div>
      <ClipLoader color="#4bb6b9" size={35} cssOverride={override} />
    </div>
  );
};

export default Loader;
